import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">

      <div class="row">
        <form class="col s12">
          <div class="row">
            <div class="input-field col s6">
              <input placeholder="Placeholder" id="first_name" type="text" class="validate"></input>
              <label for="first_name">First Name</label>
           ></div>
          </div>
        </form>
      </div>

    </div>
  );
}

export default App;
